import React, { Component, Fragment } from 'react'
import api from '../../api'
export default class Browse extends Component {

  componentDidMount() {
    api.getGoals()
      .then(goalzz => {
        console.log(goalzz)
        this.setState({
          goals: goalzz
        })
      })
      .catch(err => console.log(err))
  }
  render() {
    return (
      <Fragment>
        Browse Test
      </Fragment>
    )
  }
}
